import React from "react";
import ReactDOM from "react-dom"


const DisplayInfo = (props) => {
    const { info } = props;

    return (
        <ul>
            for(const item in info){
                <li>{item}</li>
            }
        </ul>
    );
};

export default DisplayInfo;
